import { useState } from 'react';
import { useAuth } from './AuthProvider';
import { useNavigate } from 'react-router-dom';
import { table } from '../config/airtable';
import '../styles/form.css';

// Define source type options exactly as they appear in Airtable
const SOURCE_TYPE_OPTIONS = ['Website', 'LinkedIn', 'Referral'];

const FormPage = () => {
  const [formData, setFormData] = useState({
    OrganizationName: '',
    ContactName: '',
    Email: '',
    WebsiteURL: '',
    SourceType: []
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [submitError, setSubmitError] = useState('');
  const [submitSuccess, setSubmitSuccess] = useState(false);
  const { logout } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSourceTypeChange = (e) => {
    const { value, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      SourceType: checked
        ? [...prev.SourceType, value]
        : prev.SourceType.filter(type => type !== value)
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setSubmitError('');
    setSubmitSuccess(false);

    try {
      const record = {
        fields: {
          OrganizationName: formData.OrganizationName,
          ContactName: formData.ContactName,
          Email: formData.Email,
          WebsiteURL: formData.WebsiteURL,
          SourceType: formData.SourceType // Send as array directly
        }
      };

      await table.create([record]);
      setSubmitSuccess(true);
      // Clear form after successful submission
      setFormData({
        OrganizationName: '',
        ContactName: '',
        Email: '',
        WebsiteURL: '',
        SourceType: []
      });
    } catch (error) {
      console.error('Error submitting form:', error);
      setSubmitError(`Failed to submit form: ${error.message}`);
    } finally {
      setIsSubmitting(false);
    }
  };

  const handleLogout = async () => {
    try {
      await logout();
      navigate('/');
    } catch (error) {
      console.error('Logout failed:', error);
    }
  };

  return (
    <div className="form-container">
      <div className="form-header">
        <button
          onClick={handleLogout}
          className="logout-button"
        >
          Logout
        </button>
      </div>

      <form onSubmit={handleSubmit} className="form">
        {submitSuccess && (
          <div className="success-message">
            Form submitted successfully!
          </div>
        )}
        {submitError && (
          <div className="error-message">
            {submitError}
          </div>
        )}

        <div className="form-group">
          <label className="form-label">Organization Name</label>
          <input
            type="text"
            name="OrganizationName"
            value={formData.OrganizationName}
            onChange={handleChange}
            required
            className="form-input"
            disabled={isSubmitting}
          />
        </div>

        <div className="form-group">
          <label className="form-label">Contact Name</label>
          <input
            type="text"
            name="ContactName"
            value={formData.ContactName}
            onChange={handleChange}
            required
            className="form-input"
            disabled={isSubmitting}
          />
        </div>

        <div className="form-group">
          <label className="form-label">Email</label>
          <input
            type="email"
            name="Email"
            value={formData.Email}
            onChange={handleChange}
            required
            className="form-input"
            disabled={isSubmitting}
          />
        </div>

        <div className="form-group">
          <label className="form-label">Website URL</label>
          <input
            type="url"
            name="WebsiteURL"
            value={formData.WebsiteURL}
            onChange={handleChange}
            className="form-input"
            disabled={isSubmitting}
            placeholder="https://"
          />
        </div>

        <div className="form-group">
          <label className="form-label">Source Type</label>
          <div className="checkbox-group">
            {SOURCE_TYPE_OPTIONS.map(source => (
              <label key={source} className="checkbox-label">
                <input
                  type="checkbox"
                  value={source}
                  checked={formData.SourceType.includes(source)}
                  onChange={handleSourceTypeChange}
                  disabled={isSubmitting}
                />
                {source}
              </label>
            ))}
          </div>
        </div>

        <button 
          type="submit" 
          className="submit-button"
          disabled={isSubmitting}
        >
          {isSubmitting ? 'Submitting...' : 'Submit'}
        </button>
      </form>
    </div>
  );
};

export default FormPage;
